DROP TABLE IF EXISTS `post_comments`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `post_comments` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `post_id` bigint DEFAULT NULL,
  `user_id` bigint DEFAULT NULL,
  `content` longtext COMMENT 'Nội dung comment',
  `created_at` datetime(6) NOT NULL,
  `updated_at` datetime(6) NOT NULL,
  `comment_reply` int DEFAULT NULL COMMENT 'Id của bình luận cha',
  `likes_count` int DEFAULT '0' COMMENT 'Số like',
  `user_reply_name` varchar(255) DEFAULT NULL COMMENT 'Người dùng của bình luận cha',
  `user_reply_id` int DEFAULT NULL COMMENT 'Id người dùng của bình luận cha',
  `status` int DEFAULT NULL COMMENT 'Trạng thái comment',
  `label` int DEFAULT NULL COMMENT 'Label của comment',
  `error_list` json DEFAULT NULL COMMENT 'Danh sách lỗi vi phạm comment',
  `type_report` int DEFAULT NULL COMMENT 'Loại báo cáo của người dùng.',
  `time_report` datetime(6) DEFAULT NULL COMMENT 'Thời gian người dùng báo cáo.',
  `status_positive` int DEFAULT NULL COMMENT 'Trạng thái tích cực của comment.',
  PRIMARY KEY (`id`),
  KEY `index_post_comments_on_post_id` (`post_id`),
  KEY `index_post_comments_on_user_id` (`user_id`),
  CONSTRAINT `fk_rails_56efacbd2f` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`),
  CONSTRAINT `fk_rails_bfdc8d8659` FOREIGN KEY (`post_id`) REFERENCES `posts` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1183 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

