INSERT INTO `posts` VALUES (3,7,6,'test cập nhật bài',3,'2023-10-03 15:40:00.278000','2023-11-19 05:17:40.002516',3,0,2,NULL,1,NULL,NULL,NULL),(7,6,6,'Cập nhậtfa bài viết',3,'2023-10-04 13:02:54.917520','2023-11-30 16:59:06.920002',2,1,0,NULL,5,'\"[1]\"',2,NULL),(9,7,7,'Động vật là một phần quan trọng của hệ sinh thái trái đất, đa dạng về loài và vai trò. Chúng có khả năng thích nghi với môi trường sống và thực hiện các nhiệm vụ quan trọng trong quá trình duy trì cân bằng tự nhiên. Một số loài động vật, như cá voi và báo đốm, thể hiện sự thông minh và tương tác xã hội phức tạp. Tuy nhiên, động vật hiện đang đối mặt với nhiều thách thức, như mất môi trường sống và đe dọa tuyệt chủng do hoạt động con người. Bảo vệ và quản lý đúng cách các loài động vật là một trách nhiệm quan trọng của chúng ta để bảo vệ sự đa dạng của hành tinh này và đảm bảo tương lai bền vững cho tất cả các loài sống. #kienthuc',2,'2023-10-09 17:14:06.062803','2023-12-08 10:30:03.781805',1,0,0,NULL,5,'\"[3,1]\"',2,'2023-12-08 10:30:03.773928'),(10,7,7,'Động vật là một phần quan trọng của hệ sinh thái trái đất, đa dạng về loài và vai trò. Chúng có khả năng thích nghi với môi trường sống và thực hiện các nhiệm vụ quan trọng trong quá trình duy trì cân bằng tự nhiên. Một số loài động vật, như cá voi và báo đốm, thể hiện sự thông minh và tương tác xã hội phức tạp.',3,'2023-10-10 07:23:39.151383','2023-11-19 09:31:14.827296',1,0,0,NULL,5,'\"[1]\"',NULL,NULL),(11,7,7,'Động vật là một phần quan trọng của hệ sinh thái trái đất, đa dạng về loài và vai trò. Chúng có khả năng thích nghi với môi trường sống và thực hiện các nhiệm vụ quan trọng trong quá trình duy trì cân bằng tự nhiên. Một số loài động vật, như cá voi và báo đốm, thể hiện sự thông minh và tương tác xã hội phức tạp.',1,'2023-10-10 07:25:32.630514','2023-11-17 11:48:55.886528',1,0,1,NULL,2,NULL,NULL,NULL),(12,7,7,'Động vật là một phần quan trọng của hệ sinh thái trái đất, đa dạng về loài và vai trò. Chúng có khả năng thích nghi với môi trường số